import React from 'react'
import Carousel from 'react-elastic-carousel'

 

function ItemCarousel() {
  const items = [
    { id: 1, content: 'Item 1' },
    { id: 2, content: 'Item 2' },
    { id: 3, content: 'Item 3' },
    { id: 4, content: 'Item 4' },
    // Add more items as needed
  ];
  return (
    <Carousel
    nableAutoPlay={true}
    autoPlaySpeed={100}
    pagination={true}
    isRTL={false}
    enableSwipe={true}
    enableTilt={true}
    itemsToScroll={1}
    isInfinite={true} 
    
      >
      {items.map(item => (
        <div ca>
        <a href='www.google.com' >
        <div key={item.id}>
          <h2>{item.content}</h2>
        </div>
        </a>
        </div>
      ))}
    </Carousel>
  )
}

export default ItemCarousel
